import Home from './pages/protected/Home';
import Login from './pages/auth/Login';
import Survey from './pages/protected/Survey';
import './css/App.css';
import {BrowserRouter as Router, Routes, Route } from 'react-router-dom'
import ProtectedRoutes from './utils/ProtectedRoutes';
import { useEffect } from 'react';
import firebase from './configs/firebase';
import { useSelector, useDispatch } from "react-redux";
import { saveUser } from './redux/slices/authSlice';
import ProtectedRoute from './utils/ProtectedRoutes';


function App() {
  const user = useSelector((state) => state.auth.value);
  console.log("user from state", user);
  const dispatch = useDispatch();
  useEffect(() => {
    firebase.onAuthStateChanged(firebase.auth, (user) => {
      if (user) {
        dispatch(saveUser(user.refreshToken));
      } else {
        dispatch(saveUser(undefined));
      }
    });
  }, [firebase.auth, dispatch]);

  return (
    <Router>
    <div className="app">
      <Routes>         
        <Route path="/" replace element={<ProtectedRoutes/>}>
          <Route path="/" replace element={<Home/>}/>
        </Route>
        <Route path='/survey' replace element={<Survey/>}/>
        <Route path='/home' replace element={<Home/>}/>
      </Routes>
    </div>
    </Router>
  );
}

export default App;
